import React, { useState } from 'react';
import { createBooking } from '../api';

function Booking() {
  const [details, setDetails] = useState({ serviceId: '', date: '' });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await createBooking(details);
      alert('Booking created');
    } catch {
      alert('Booking failed');
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input placeholder="Service ID" onChange={e => setDetails({ ...details, serviceId: e.target.value })} />
      <input type="date" onChange={e => setDetails({ ...details, date: e.target.value })} />
      <button type="submit">Book Now</button>
    </form>
  );
}

export default Booking;
